import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import toast from "react-hot-toast";

function CreateResume() {
  const [inputs, setInputs] = useState({
    name: "",
    // email: "",
    number: "",
    DOB: "",
    gender: "",
    religion: "",
    nationality: "",
    maritalStatus: "",
    hobbies: "",
    language: "",
    address: "",
    experiences: [],
    education: [],
    skills: [],
  });

  const handleChange = (e) => {
    setInputs((prevState) => ({
      ...prevState,
      [e.target.name]: e.target.value,
    }));
  };

  const handleNestedChange = (e, section) => {
    const { name, value } = e.target;
    setInputs((prevState) => ({
      ...prevState,
      [section]: {
        ...prevState[section],
        [name]: value,
      },
    }));
  };

  const handleAddExperience = () => {
    setInputs((prevState) => ({
      ...prevState,
      experiences: [...prevState.experiences, prevState.experienceInputs],
      experienceInputs: {},
    }));
  };

  const handleAddEducation = () => {
    setInputs((prevState) => ({
      ...prevState,
      education: [...prevState.education, prevState.educationInputs],
      educationInputs: {},
    }));
  };

  const handleAddSkill = () => {
    setInputs((prevState) => ({
      ...prevState,
      skills: [...prevState.skills, prevState.skillsInputs],
      skillsInputs: {},
    }));
  };

  const handleSubmit = async (e) => {
    /* eslint-disable */console.log(...oo_oo(`2007020890_67_4_67_24_4`,"enter"));
    e.preventDefault();

    const dataToSubmit = {
      ...inputs,
      // Make sure to add default empty arrays for these fields if they are not set
      experiences: inputs.experiences || [],
      education: inputs.education || [],
      skills: inputs.skills || [],
    };

    /* eslint-disable */console.log(...oo_oo(`2007020890_78_4_78_48_4`,"Data to submit:", dataToSubmit));

    try {
      const { data } = await axios.post(
        "http://localhost:3000/product", // Make sure this matches your server route
        dataToSubmit
      );

      if (data.success) {
        toast.success("Resume submitted successfully");
      } else {
        toast.error("Resume submission failed");
      }
    } catch (error) {
      if (error.response) {
        console.error("Error response:", error.response);
